import React from 'react'

const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Ranking</th>
                <th>Listing Id</th>
            </tr>
        </thead>
    );
}

const TableRow = ({ value }) => {
    return (
        <tr >
            <td>{value.Ranking}</td>
            <td>{value.ListingId}</td>
            <td>{value.Make}</td>
            <td>{value.SellingPrice}</td>
            <td>{value.Mileage}</td>
            <td>{value.NumberOfContacts}</td>
        </tr>
    );
}
const Distributions = ({ distributions }) => {
    return (
        <div>
            <center><h1>Percentual distributions of available cars by make</h1></center>
            <div className="card">
                {distributions.map((distribution) => (

                    <div className="card-body">
                        <h5 className="card-title">{distribution[0]}</h5>
                        <p className="card-text">{distribution[1]}%</p>
                    </div>
                ))}
            </div>
        </div>
    )
};

export default Distributions
